function computeOverallRating(){let finalRatings=$(".final_rating"),total=0;Object.values(finalRatings).forEach((element,index)=>{if(index<finalRatings.length){let fr=parseFloat($(element).text());total+=fr,$(element).html(fr.toFixed(2)+"&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp"+getRate(fr.toFixed(2)))}});const average=total.toFixed(2)/finalRatings.length;let intrepretation=getRate(total.toFixed(2));$(".overall").html(average+"&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp"+intrepretation)}function getRate(overallRate){return overallRate<=1.49?"E":overallRate<=2.49?"VG":overallRate<=3.49?"G":overallRate<=4.499?"F":"P"}$((function(){$("#print").click((function(){window.print()})),computeOverallRating()}));